import React from 'react'

function formField() {
    return (
        <div>
            <label>
                Nome da Categoria
                    <input
                    type="text"
                    name="nome"
                    value={values.nome}
                    onChange={handleChange}
                />
            </label>
        </div>
    )
}

export default formField;
